from itertools import count, islice
def agen(): # generator of terms
    k, den, pow = 0, 1, 0
    for n in count(1):
        sn = str(n)
        k = k*10**len(sn) + n
        den *= 10**len(sn)
        pow += len(sn)
        nr, c2, c5 = k*(den+1), pow, pow
        while nr%2 == 0 and c2 > 0: nr //= 2; c2 -= 1
        while nr%5 == 0 and c5 > 0: nr //= 5; c5 -= 1
        yield nr
